import { createContext, useReducer } from "react"
import Gallary from "./Gallary"
import Product from "./Product"

const allData = {
    gallary: {
        title: 'gallary',
        data: ['A', 'B', 'C', 'D']
    },
    product: {
        title: 'product',
        data: ['E', 'F', 'G', 'H']
    },
}
export const GallaryContaxt = createContext()

const parentReducer = (state, action) => {
    if (action) {
        return {}
    }
    else {
        return state
    }
}

function Main() {
    const [stateGallary, dispatch] = useReducer(parentReducer, allData.gallary)
    return (
        <div>
            <GallaryContaxt.Provider value={stateGallary}>
                <Gallary />
                {/* <Product /> */}
            </GallaryContaxt.Provider>



        </div>
    )
}
export default Main
